import { Icon } from '@iconify/react';
import { useState } from "react";

function UploadFile()
{
    const [age, setAge] = useState('');

    const handleChange = (event) => {
      setAge(event.target.value);
    };

    return(
        <>

            <Grid container direction="row" justifyContent="center" alignment="center" my={25} mr={50}>
                <Stack>




                </Stack>

                <Box
                    sx={{
                    boxShadow: 3,
                    width: '700px',
                    height: '20',
                    bgcolor: (theme) => (theme.palette.mode === 'dark' ? '#101010' : '#fff'),
                    color: (theme) =>
                        theme.palette.mode === 'dark' ? 'grey.300' : 'grey.800',
                    p: 1,
                    m: 1,
                    borderRadius: 5,
                    textAlign: 'center',
                    fontSize: '0.875rem',
                    fontWeight: '700',
                    alignment:'center'
                    }}
                    alignment="center"
                    justifyContent="center"
                    >

                    <Input
                        style={{
                        display: "none"
                        }}
                        accept=".json"  // specify the file type that you wanted to accept
                        id="choose-file"
                        type="file"
                        onChange={''}
                    />
                        <label htmlFor="choose-file">
                            <Icon icon="bi:upload" color="blue" width="200" height="200" />
                        </label>



                        <Box>
                        <Button variant="outlined" color='success'>Submit</Button>
                        </Box>
                </Box>
            </Grid>

        </>
    );



}


export default UploadFile;
